CKFinder.define(function(){var n={init:function(n){n.on("folder:selected",function(n){$(".ui-btn-active").next().click()}),n.on("folder:getFiles:after",function(n){for(var e=$(".ckf-file-desc p"),t=0;t<e.length;t++){var i=e[t],r=(i.outerHTML,i.innerHTML),s=r.split("<br>");i.innerHTML='<span class="jy-date">'+s[0]+'</span><span class="jy-size" style="float: right;">'+s[1]+"</span>"}})}};return n});